import React, { useState } from "react";
import { Modal } from "antd";

export default function ModalDetail(isVisible: any, handleCancel: any) {
  return (
    <>
      <Modal
        title="Basic Modal"
        visible={isVisible}
        onOk={handleCancel}
        onCancel={handleCancel}
      >
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Modal>
    </>
  );
}
